const GuidePage = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">이용 가이드</h1>
      <div className="space-y-4">
        <p>예약 이용 가이드 내용이 들어갑니다.</p>
      </div>
    </div>
  );
};

export default GuidePage;
